	return (
	<>
		<Topbar />
		<div className="profile">
			<Sidebar />
				<div className="profileRight">
					<div className="profileRightTop">
						<div className="profileCover">
							<img src="assets/post/3.png" alt="" className='profileCoverImg'/>
							<img src="assets/person/1.jpg" alt="" className='profileUserImg'/>
							<div className="profileInfo">
								<h4 className="profileInfoName">altosaex</h4>
								<span className="profileInfoDesc">コーチングスクールの講師をしています</span>
							</div>
						</div>
					</div>
						<div className="profileRightBottom">
					<TimeLine />
					<Rightbar profile />
						</div>
				</div>
		</div>
	</>
	);
}
